// src/App.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/countrydata')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div className="App">
      <h1>Country Data</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>
            {item.country_name} - {item.indicator_name} ({item.year}): {item.value}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
